body:
Мы ищем автора мемовостей!

Наверняка вы заметили, что последний месяц у нас в паблике регулярно выходят #мемовости@tnull. Так вот, мы хотим радовать вас таким контентом ещё больше, в связи с чем нам в команду нужен ещё один автор.

Что нужно делать? 
— каждый день находить 2–3 актуальные/интересные/орные новости из сферы IT и разработки;
— превращать их в посты со смешными мемами.

Вот такие крутые посты мы хотим видеть в итоге:
— https://vk.com/wall-72495085_1031318 
— https://vk.com/wall-72495085_1024087 
— https://vk.com/wall-72495085_1027174

Каким мы видим нашего автора? 
Наш автор 
— грамотно пишет на русском;
— обладает хорошим чувством юмора;
— шарит в актуальных и классических мемах; 
— каждый день выходит на связь; 
— готов оперативно обрабатывать инфоповоды;
— не воспринимает правки постов на свой счёт и готов работать с ними.

Можно работать удалённо, зарплату определим по итогам собеседования.

Хотите присоединиться к команде? Тогда сделайте в предложку паблика актуальную мемовость. С теми, чьи мемовости нам понравятся, мы свяжемся и продолжим общение.

P.S. Мемовости из предложки без разрешения публиковать не будем. А если нам что-то понравится, и вы разрешите, то опубликуем и оплатим работу.

Тебе интересно, как создаются игры? Хочешь не только услышать теорию, но и самостоятельно написать игру на Unity? На это потребуется всего три вечера!

Присоединяйся к бесплатному интенсиву 
🔜 https://vk.cc/a02TzG. 

Ты научишься:
✔ управлять камерой;
✔ создавать фон;
✔ программировать движение объекта;
✔ добавлять противников;
✔ создавать препятствия и эффекты;
✔ добавлять звуковое оформление.
Каждый сможет задать вопросы преподавателю и пообщаться с другими участниками интенсива в закрытом чате в Telegram.

Три автора лучших проектов получат сертификаты на 30 000 рублей для поступления на любой курс Skillbox!
